import React from "react";
import "./style.css";

function Coding() {
  return (
    <div className="wrapper position-relative mb-4">
      <a href="https://github.com/eurbaezjr">
        <img className="img-fluid" id="coding-image" src="https://www.imagesysit.com/images/easyblog_shared/November_2018/11-5-18/learning_code_400.jpg" alt="Full-Stack Coding" />
        <div className="box-6 position-absolute">Coding Samples</div>
      </a>
    </div>
  );
}

export default Coding;
